package pl.szymontomalik.PhotoGalleryApp.entities;import lombok.Getter;import lombok.Setter;import javax.persistence.*;import javax.validation.constraints.NotBlank;import javax.validation.constraints.NotNull;@Entity@Getter@Setter@Table(name = "photographs")public class Photography {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private long id;    @NotBlank(message = "File name is mandatory")    private String userFileName;    private int size;    private String mimeType;    private String fileName;    private String url;    @ManyToOne    @NotNull    private Album album;    public Photography(String url) {    }}